import "./index.css"
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";



const Kacla = () => {
    return (

        <>
            <div  style={{ backgroundColor: 'royalblue', width: '100vw', height: '100vh' }} class=' bg-center text-center full-width cover-full my-0 mt-0'>


                <img class = 'mt-5' width='1200px' src="/images/Ka_CLA.png" alt="" />

                <div class='text-bottom my-5'>

                    <a href='http://accel.arrisi.com/pages/Racks.aspx?groupID=25&codeTrackID=42&timeframe=0&EndDate=InProgress'>
                        <button style={{ backgroundColor: 'yellow'}} type="button" class="btn btn-primary btn-lg btn-center text-bottom">Accel Link</button>&nbsp;&nbsp;
                    </a>
                    <button type="button" class="btn btn-primary btn-lg">CLA Link</button>

                </div>


            </div>

        </>

    );
}


export default Kacla;
